import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faPaperPlane } from "@fortawesome/free-solid-svg-icons";

function Entry() {
  return (
    <form className="entry">
      <input type="text" />
      <button>
        <FontAwesomeIcon icon={fasfaPaperPlane} />
      </button>
    </form>
  );
}

export default Entry;
